import { Text, View, StyleSheet } from 'react-native'

const App = () => {
  return (<View>
    <Text style={styles.colorSty}>你好， react native</Text>
    <Text style={styles.secondLine}>这是react native 第二行</Text>
  </View>)
}

const styles = StyleSheet.create({
  colorSty: {
    color: "#666",
    width: 370,
    display: 'inline-block',
    backgroundColor: '#999',
    textAlign: 'center',
    fontSize: 20
  },
  secondLine: {
    fontSize: 15,
    color: 'salmon',
  }
})

export default App;
